INSERT INTO `tp_article` VALUES ('1', '3', '新淘商城奖金规则详细介绍', '&lt;p&gt;1.全球关系算力：拿上级日算力的30%&lt;/p&gt;&lt;p&gt;2.动态算力收益：（极差发放）&lt;/p&gt;&lt;p&gt;直接分享区块动能算力:日算力：70%&lt;/p&gt;&lt;p&gt;创业合伙区块动能算力:日算力：120%（直接分享三个VIP会员+团队总算力50万G）&lt;/p&gt;&lt;p&gt;经销推广区块动能算力:日算力：150%（直接分享五个VIP会员+团队总算力100万G）&lt;/p&gt;&lt;p&gt;代理区域区块动能算力:日算力：180%（直接分享七个VIP会员+团队总算力300万G）&lt;/p&gt;&lt;p&gt;股东合伙区块动能算力:日算力：200%（直接分享九个VIP会员+团队总算力1000万G）&lt;/p&gt;&lt;p&gt;(注:vip会员：持有10个新淘链以上为vip会员)&lt;/p&gt;&lt;p&gt;3.平级算力：下级日动能总算力的20%&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/public/upload/temp/2018/07-03/1df7d967ace02fc26d9b5af0055c0b22.jpg&quot; title=&quot;1df7d967ace02fc26d9b5af0055c0b22.jpg&quot; alt=&quot;1df7d967ace02fc26d9b5af0055c0b22.jpg&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '', '', '', '2', '1', '1528345428', '', '0', '', '', '1064', '1530547200', '');
INSERT INTO `tp_article` VALUES ('2', '4', '新淘商城各类币种介绍', '&lt;p&gt;1.【消费算力】：购物消费1：1送消费算力。用于挖矿和新淘链交易&lt;/p&gt;&lt;p&gt;2.账户余额：线上充值获得，用于购物，认筹。&lt;/p&gt;&lt;p&gt;3.新淘链：消费算力每日释放量/新淘链价格进入新淘链钱包，保留6位小数。&lt;/p&gt;&lt;p&gt;4.提现币：会员卖出成功新淘链得到提现币，用于提现。&lt;/p&gt;', '', '', '币种介绍', '2', '1', '1529487297', '', '0', '', '', '1226', '1530547200', '/public/upload/article/2018/06-30/415e217fe598061ae518d46eb9d1a18c.png');
INSERT INTO `tp_article` VALUES ('3', '4', '新淘商城会员级别介绍', '&lt;p&gt;1.一星会员：持有10-199G个消费算力 每日算力0.1% 新淘链&lt;/p&gt;&lt;p&gt;2.二星会员：持有200-1499G消费算力 &amp;nbsp;每日算力0.15% 新淘链&lt;/p&gt;&lt;p&gt;3.三星会员：持有1500-2999G消费算力 每日算力0.2% 新淘链&lt;/p&gt;&lt;p&gt;4.四星会员: 持有3000-4999G消费算力 每日算力0.25% 新淘链&lt;/p&gt;&lt;p&gt;5.五星会员: 持有5000-10000G消费算力 每日算力0.3% 新淘链&lt;/p&gt;', '', '', '', '2', '1', '1530574299', '', '0', '', '', '1149', '1530633600', '');
INSERT INTO `tp_article` VALUES ('5', '4', '新淘商家入驻须知', '&lt;p&gt;一：入驻前准备 &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p&gt;1.商家入驻使用商家后台电脑端操作。&lt;/p&gt;&lt;p&gt;2.是新淘商城用户，并且持有新淘链。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;二：结款周期、方式&lt;/p&gt;&lt;p&gt;1.买家确认收货7天后自动结算于商家后台。&lt;/p&gt;&lt;p&gt;2.提现可直接提现到支付宝和银行卡。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;三：商城服务&lt;/p&gt;&lt;p&gt;新淘商城为商家提供后台权限，由商家自行上架商品、发货、交易、售后。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;四：退换货条款及流程&lt;/p&gt;&lt;p&gt;（一）符合退货情况&lt;/p&gt;&lt;p&gt;1.商品本身有质量问题（需要顾客拍照证实）或者实际收到的产品与网站描述有明显不一致的，承诺顾客自签收日期起不超过7日的允许退货。&lt;/p&gt;&lt;p&gt;2.商品没有质量问题，顾客对商品的某个方面（如颜色，款式，材质，尺寸）不满意，不影响二次销售的情况下，自顾客签收日期起步超过7日的可以协商退货。（此情况，由顾客承担退回运费）&lt;/p&gt;&lt;p&gt;（二）符合换货情况&lt;/p&gt;&lt;p&gt;1.商品本身有质量问题（需要顾客拍照证实），签收日期起15日允许换货。&lt;/p&gt;&lt;p&gt;2.商品没有质量问题，顾客对商品的某个方面（如颜色，款式，材质，尺寸）不满意，不影响二次销售的情况下，签收日期起15日可以换货。（此情况，由顾客承担退回和寄出运费)&lt;/p&gt;&lt;p&gt;（三）在以下情况我们有权拒绝客户的退换货要求 ?&lt;/p&gt;&lt;p&gt;1.超过退换货期限的退换货要求&lt;/p&gt;&lt;p&gt;2.退换货物不全或者受损&lt;/p&gt;&lt;p&gt;3.客户发货单据丢失或者不全&lt;/p&gt;&lt;p&gt;4.产品并非我们提供&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;商家后台:https://58xintao.com/seller/Admin/login&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '', '', '', '2', '1', '1530598851', '', '0', '', '', '1265', '1530633600', '');
